import React from "react";

interface Props {
  start_x: string;
  start_y: string;
  end_x: string;
  end_y: string;
  hiearchy_number: number;
  list_of_subjects: string[];
}

const Arrow = ({
  start_x,
  end_x,
  start_y,
  end_y,
  hiearchy_number = 0,
  list_of_subjects,
}: Props) => {
  const concentration_positions: any[] = [
    ["synthetic", ["19.09%", "64.72%"]],
    ["cell", ["44.09%", "64.72%"]],
    ["devices", ["69.09%", "64.72%"]],
    ["imaging", ["69.09%", "64.72%"]],
  ];
  let bottomLine: string;
  bottomLine = (hiearchy_number + 63).toString();
  return (
    <svg className="full">
      <line className="arrow" x1={start_x} y1={start_y} x2="5%" y2={start_y} />
      <line className="arrow" x1="5%" y1={start_y} x2="5%" y2="63%" />
      <line className="arrow" x1="5%" y1={start_y} x2="5%" y2="63%" />
    </svg>
  );
};

export default Arrow;
